import React from 'react';

const SuperViewFrom = React.memo(function ({columns, item}) {
    function addressConcatenation(item){

        return item || item['address']['streetAddress'] + ' ' + item['address']['city'] + ' '
            + item['address']['state']+ ' ' + item['address']['zip'];
    }

    return <tbody>
        {columns.map((col)=><tr>
            <td>{col}</td>
            <td>{col === 'address' ? addressConcatenation(item) : item[col]}</td>
        </tr>)}
    </tbody>
});

export default SuperViewFrom;
